import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import { Provider } from "react-redux";
import { BrowserRouter as Router, Link, Route, Routes } from 'react-router-dom';
import LandingPage from "./components/LandingPage";
import Profile from './components/ProfilePage/Profile';
import LogInPage from './components/LogInPage';
import { fetchUsers, fetchPosts } from './reducers';
import MainPage from './components/MainPage/MainPage';
import store from './store'
import ProtectedMain from './components/ProtectedMain';

import reportWebVitals from './reportWebVitals';
import ProtectedProfile from './components/ProtectedProfile';

const root = ReactDOM.createRoot(document.getElementById('root'));
store.dispatch(fetchUsers)
store.dispatch(fetchPosts)

//Todo make sure user cannot access protected page before logging in
root.render(
  <React.StrictMode>
    <Provider store = {store}>
      <Router>
        <Routes>
          <Route exact path={"/"} element={<LandingPage />} />
          <Route path={"/profile"} element={<ProtectedProfile><Profile /></ProtectedProfile>} />
          <Route path={"/login"} element={<LogInPage/>} />
          <Route path={"/main"} element={<ProtectedMain><MainPage/></ProtectedMain>} />
        </Routes>
      </Router>
    </Provider>
  </React.StrictMode>
);

// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
reportWebVitals();
